<html lang="en" style="background: white;height: 100%;">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Document</title>
    <script src="https://pixel-demo.web.bytedance.net/lib/vue.js"></script>

    <link rel="stylesheet" href="https://unpkg.com/element-ui/lib/theme-chalk/index.css">
    <!-- 引入组件库 -->
    <script src="https://unpkg.com/element-ui/lib/index.js"></script>

    <style>
        .jsb-item {
            margin: 10px;
        }

        .result {
            word-break: break-all;
            white-space: break-spaces;
        }

        .el-textarea__inner{
            max-height: 1000px !important;
        }
    </style>
</head>
<body>
<div id="app">
    <el-form ref="form" :model="form" label-width="80px">
        <el-form-item label="UserAgent">
            {{userAgent}}
        </el-form-item>
        <el-form-item label="Platform">
            {{platform}}
        </el-form-item>
        <el-form-item label="Current URL">
            {{currentURL}}
        </el-form-item>
        <el-form-item label="Referrer">
            {{referrer}}
        </el-form-item>
        <el-form-item label="JSB Name">
            <el-radio-group v-model="form.jsb">
                <el-radio
                        v-for="i in jsbMap[platform]"
                        :id="i"
                        border
                        :label="i"
                        class="jsb-item"
                        @change="onRadioChange"
                >{{i}}
                </el-radio>
                <el-radio label="other">
                    <el-input v-if="form.jsb==='other'" v-model="otherJsb" border></el-input>
                </el-radio>
            </el-radio-group>
        </el-form-item>
        <el-form-item label="Data">
            <el-input style="" type="textarea" v-model="form.data" autosize></el-input>
        </el-form-item>
        <el-form-item class="result" label="Result">{{JSON.stringify(result, ' ', ' ')}}</el-form-item>
        <el-form-item>
            <el-button type="primary" @click="onSubmit">Submit</el-button>
            <el-button @click="onClear">Clear</el-button>
        </el-form-item>
        <el-form-item label="Url">
            <el-input type="textarea" v-model="form.url"></el-input>
        </el-form-item>
        <el-form-item>
            <el-button type="primary" @click="onJump">Jump</el-button>
        </el-form-item>
    </el-form>
</div>

                userAgent: navigator.userAgent,
                platform: getPlatform(),
                jsbMap: {
                    ios: iOSJSBList,

                    pc: [].concat(iOSJSBList, androidJSBList)
                },
                jsbMockData,
                form: {
                    jsb: '',
                    data: JSON.stringify({}),
                    url: 'https://'
                },
                otherJsb: '',
                result: {}
            }
        },
        methods: {
            onRadioChange(id) {
                if (this.jsbMockData[id]) {
                    this.form.data = JSON.stringify(this.jsbMockData[id], ' ', ' ')
                } else {
                    this.form.data = '{}'
                }
            },
            onSubmit() {
                let jsbName = this.form.jsb
                if (jsbName === 'other') {
                    jsbName = this.otherJsb
                }

                const delayReport = jsbName === 'sendLog(__5s_TIMEOUT__)'

                jsbName = jsbName.replace('(__GET__)', '')
                jsbName = jsbName.replace('(__ACT__)', '')
                jsbName = jsbName.replace('(__SHOP_ACT__)', '')
                jsbName = jsbName.replace('(__5s_TIMEOUT__)', '')

                if (delayReport) {
                    setTimeout(() => {
                        window.ToutiaoJSBridge.call(jsbName, JSON.parse(this.form.data), (data) => {
                            this.result = data
                        })
                    }, 5000)
                } else {
                    window.ToutiaoJSBridge.call(jsbName, JSON.parse(this.form.data), (data) => {
                        this.result = data
                    })
                }
            },
            onClear() {
                this.form.jsb = ''
                this.form.data = ''
            },
            onJump() {
                location.href = this.form.url
            }
        }
